import React from 'react'
import Rating from '../../../Rating/Rating';
import '../../../Product/Product.css';
export default function Product(props) {
    const {menPro} = props;
    return (
       <div key= {menPro._id} className="pCard">
  <a href={`/menPro/${menPro._id}`}>
    <img className ="medium" src={menPro.image} alt={menPro.name}/>
    </a>
    <div className= "pCard-body">
      <a href={`/menPro/${menPro._id}`}><h2> {menPro.name}</h2></a>
      <Rating rating={menPro.rating} numReviews = {menPro.numReviews}></Rating>
      <div className="price">
      Rs. {menPro.price}
      </div>
    </div>
  </div>
    )
}
